import React from "react";
import ReactDOM from "react-dom";

//ReactDOM.render(<p>Apex Ensino</p>, document.getElementById("root"));


//Lista
let lista = (
<fieldset>
    <ul>
        <li>html</li>
        <li>css</li>
        <li>Javascript</li>
        <li>Node</li>
        <li>core</li>
        <li>dual</li>
        <li>tres</li>
        <li>dois</li>
    </ul>
</fieldset>
);


//Formulario
let form = (
<fieldset>
    <form>
        <label>Nome</label>
        <input type="text"></input><br></br>
        <label>Senha</label>
        <input type="password"></input><br></br>
        <label>Email</label>
        <input type="email"></input><br></br>
        <input type="submit"></input>
    </form>
</fieldset>
);

//video

let video = (
    <iframe width="25%" height="250" class="yvideo" id="pgHr6luyjjs"
       src="https://www.youtube.com/watch?v=MczwQBm6c8E"			    
       frameborder="0" allowfullscreen>
<p>Seu navegador não possui Suporte para este recurso...</p>
</iframe>
)




//Tabela
let tab = (
<fieldset>    
    <table border="1">
        <tr>
            <th>Produto</th>
            <th>Marca</th>
            <th>Valor</th>
        </tr>
        <tr>
            <td>mamaco</td>
            <td>Lacoste</td>
            <td>10</td>
        </tr>
        <tr>
            <td>mamaco2</td>
            <td>lacoste</td>
            <td>20</td>
        </tr>
        <tr>
            <td>Mascote</td>
            <td>Adidas</td>
            <td>30</td>
        </tr>
        <tr>
            <td>rei Lacoste</td>
            <td>Nike</td>
            <td>350</td>
        </tr>
        <tr>
            <td>Faixa</td>
            <td>Lacoste</td>
            <td>50</td>
        </tr>
    </table>
</fieldset>
);

// const element = <h1>Hello, world</h1>;
function tick (){
    const element = (
        <div>
            <h1>Corno Manso</h1>
            <p>Paragrafo do Corno Manso</p>
            <p>Paragrafo do Corno Manso2</p>
        </div>
    )
    ReactDOM.render(element,document.getElementById("palavras"))
};


//Parte dos React Dom
ReactDOM.render(video,document.getElementById("video"));
ReactDOM.render(lista,document.getElementById("root"));
ReactDOM.render(form, document.getElementById("form"));
ReactDOM.render(tab,document.getElementById("tab"));

setInterval(tick,1000);
